
        export async function loadModuleAsync(name):Promise<any> {
            //Autogenerated
            /* Webpack use module name for loading and computing code bundle and split chunk so we cannot introduce variable in the import thus we create this redirecting file*/
            switch (name) {
                
            case "@root/modules/ammo/AmmoPhysics": return import("@root/modules/ammo/AmmoPhysics");
            case "@root/modules/controller/cameraController/OrbitController": return import("@root/modules/controller/cameraController/OrbitController");
            case "@root/modules/controller/pathFindingPlayer/Input": return import("@root/modules/controller/pathFindingPlayer/Input");
            case "@root/modules/controller/pathFindingPlayer/NavMeshPlayer": return import("@root/modules/controller/pathFindingPlayer/NavMeshPlayer");
            case "@root/modules/controller/physicPlayerControl/Input": return import("@root/modules/controller/physicPlayerControl/Input");
            case "@root/modules/controller/physicPlayerControl/PlayerControls": return import("@root/modules/controller/physicPlayerControl/PlayerControls");
            case "@root/modules/core/WorldService": return import("@root/modules/core/WorldService");
            case "@root/modules/FrameLoop": return import("@root/modules/FrameLoop");
            case "@root/modules/portals/PortalLink": return import("@root/modules/portals/PortalLink");
            case "@root/modules/portals/PortalsService": return import("@root/modules/portals/PortalsService");
            case "@root/modules/scenes/demo1/GLTFScene": return import("@root/modules/scenes/demo1/GLTFScene");
            case "@root/modules/scenes/demo2/LevelSetup": return import("@root/modules/scenes/demo2/LevelSetup");
            case "@root/modules/scenes/demo2/Sky2": return import("@root/modules/scenes/demo2/Sky2");
            case "@root/modules/scenes/demo3/SpokeRoomLoader": return import("@root/modules/scenes/demo3/SpokeRoomLoader");
            case "@root/modules/three/ThreeLib": return import("@root/modules/three/ThreeLib");
                default: throw new Error(name+" not found in module list - please run npm run pre-build");
            }
        }